function setup() {
  c = createCanvas(windowWidth, windowHeight)
  c.style("z-index", 1000)
  c.style("pointer-events", "none")
  c.elt.style.position = "fixed"
  c.position(0,0)

  radio = createRadio()
  radio.position(windowWidth-100,0)
  radio.style("z-index", 1000)
  radio.option('DRAWING')
  radio.option('BUBBLES')
  radio.option('SPARKLE')
  radio.style('width', '90px')
  radio.changed(clearBackground)
  textAlign(CENTER)
  fill(255, 0, 0)
}

